import React from 'react';
import './Picker.css';

/**
 * Picker component.
 */
class Picker extends React.Component {
  /**
   * @return {object} a <div> containing the picker
   */
  render() {
    return (
      <div id = "picker">
        <div class = "header">
          <button id = "prev" onClick={prev}>prev</button>
          <div id = "display" onclick={display}></div>
          <button id = "next" onClick={next}>next</button>
        </div>
        <div class = 'extradays'></div>
        <div class = 'days'>
          <div class ='day0'>S</div>
          <div class ='day1'>M</div>
          <div class ='day2'>T</div>
          <div class ='day3'>W</div>
          <div class ='day4'>T</div>
          <div class ='day5'>F</div>
          <div class ='day6'>S</div>
        </div>
     </div>
      // <div></div>
    //  <><button id = "prev">&#xab</button></>
      // <button id = "next">&#xbb</button>
    );
  }
}

const next = () =>{
  console.log('next');
};
const prev = () =>{
  console.log('prev');
};
const display = () =>{
  console.log('display');
};
export default Picker;
